export function nsbutton({
  children,
  componentClasses,
  version,
  textBtn,
  deleteLink,
  formId,
  disabled,
  ...rest
}) {
  const classes = NSButtonStyles();
  const danger = version === 3 ? classes.negative : classes.primary;
  const type = version === 2 ? classes.secondary : danger;

  return (
    <NSButton 
      onClick={action('I was clicked')}
      variant="contained"
      color="primary"
      size="large"
      className={classes.confirmBtn}
      form={formId}
      type={classes.secondary}
      disabled={disabled}
      >Primary
    </NSButton>
  )
}
